import React, { useState, useEffect } from 'react';

function Admin() {
  const [productos, setProductos] = useState([]);
  const [formData, setFormData] = useState({
    nombre: '',
    precio: '',
    categoria: 'Hombre',
    imagen: '',
    descripcion: ''
  });

  useEffect(() => {
    cargarProductos();
  }, []);

  const cargarProductos = async () => {
    try {
      const response = await fetch('http://localhost:3001/api/productos');
      const data = await response.json();
      setProductos(data);
    } catch (error) {
      console.error('Error al cargar productos:', error);
    }
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const agregarProducto = async (e) => {
    e.preventDefault();

    if (!formData.nombre || !formData.precio || !formData.imagen || !formData.descripcion) {
      alert('Por favor completa todos los campos');
      return;
    }

    try {
      await fetch('http://localhost:3001/api/productos', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          ...formData,
          precio: parseFloat(formData.precio)
        })
      });

      alert('Producto agregado exitosamente');
      setFormData({
        nombre: '',
        precio: '',
        categoria: 'Hombre',
        imagen: '',
        descripcion: ''
      });
      cargarProductos();
    } catch (error) {
      console.error('Error al agregar producto:', error);
    }
  };

  const eliminarProducto = async (id) => {
    if (window.confirm('¿Eliminar este producto?')) {
      try {
        await fetch(`http://localhost:3001/api/productos/${id}`, {
          method: 'DELETE'
        });
        alert('Producto eliminado');
        cargarProductos();
      } catch (error) {
        console.error('Error al eliminar producto:', error);
      }
    }
  };

  return (
    <section className="admin">
      <div className="container">
        <h2>Panel de Administración</h2>

        <div className="admin-form">
          <h3>Agregar Producto</h3>
          <form onSubmit={agregarProducto}>
            <input
              type="text"
              name="nombre"
              placeholder="Nombre"
              value={formData.nombre}
              onChange={handleChange}
            />
            <input
              type="number"
              name="precio"
              placeholder="Precio (Q)"
              step="0.01"
              value={formData.precio}
              onChange={handleChange}
            />
            <select name="categoria" value={formData.categoria} onChange={handleChange}>
              <option value="Hombre">Hombre</option>
              <option value="Mujer">Mujer</option>
              <option value="Unisex">Unisex</option>
            </select>
            <input
              type="text"
              name="imagen"
              placeholder="Nombre de imagen (ej: camisa1.jpg)"
              value={formData.imagen}
              onChange={handleChange}
            />
            <textarea
              name="descripcion"
              placeholder="Descripción"
              value={formData.descripcion}
              onChange={handleChange}
            />
            <button type="submit">Agregar Producto</button>
          </form>
        </div>

        <div className="admin-lista">
          <h3>Productos Existentes</h3>
          <div className="admin-productos">
            {productos.map(producto => (
              <div key={producto.id} className="admin-producto-item">
                <div>
                  <strong>{producto.nombre}</strong> - Q{producto.precio.toFixed(2)} ({producto.categoria})
                </div>
                <button onClick={() => eliminarProducto(producto.id)}>
                  Eliminar
                </button>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
}

export default Admin;
